projectVersions.objective:
ALIMA et son partenaire Alerte Santé auront pour objectif de contribuer à la réduction de la mortalité des enfants de moins de 5 ans dans la région sanitaire de N'Djamena à travers l'amélioration des statuts sanitaires et nutritionnels de 80985 enfants de moins de 5 ans et femmes enceintes et allaitantes (27157 hommes et 53828 femmes) à travers les activités de prise en charge, de sensibilisation à la malnutrition aigüe sévère et le renforcement des capacités de 78 professionnels de santé dans les zones d’intervention dont 18 hommes et 60 femmes.  
Dans la région sanitaire de N'Djamena, le projet poursuivra l'appui à la prise en charge de la MAS en en hospitalisation dans l'UNT HATC et dans la nouvelle UNT de Gozattor. La prise en charge des enfants MAS en ambulatoire s'effectuera dans les 16 UNA soutenues en 2018. Cela se fera par le biais du système de circuit unique permettant le dépistage systématique de la MAS de tous les enfants de moins de 5ans se présentant dans le centre de santé et le rattrapage de la vaccination pour la mère et l'enfant. Des campagnes de dépistages de masse couplés au formation PB mères seront intégrés dans le projet afin d’assurer une prise en charge précoce et préventive. 
Tel que l'énonce la Charte ALIMA "le patient d'abord", le bénéficiaire est au centre de tout dispositif d'intervention de l'organisation. L'ONG médicale entend donc exécuter son mandat de manière responsable en tenant en compte des spécificités ou non des populations qu'elle assiste et vis-à-vis desquelles elle sera redevable tout au long du cycle de projet. 
Les populations affectés sont considérées comme des "partenaires" et intégrées dans la programmation humanitaire, notamment dans l'identification des besoins, le conceptualisation, la mise en oeuvre de la réponse, le suivi et l'évaluation de fin de cycle. 
Ainsi, ALIMA s'engage à :
- incorporer systématiquement la notion de redevabilité dans sa programmation; 
- assurer la transparence à travers le partage d'informations avec la population affectée; 
- mettre en place un mécanisme de collecte et traitement des feedbacks et plaintes; 
- promouvoir la participation et l'engagement de la population affectée afin de renforcer l'appropriation locale et la résilience; 
- promouvoir un système de planification, suivi et évaluation participatif.

